import React from "react";
import { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

const Home: React.FC = () => {
  const busRoutes = {
    Gold: ["Stop A", "Stop B", "Stop C"],
    Red: ["Stop D", "Stop E", "Stop F"],
    Blue: ["Stop G", "Stop H", "Stop I"],
    Green: ["Stop J", "Stop K", "Stop L"],
  };

  const [selectedRoute, setSelectedRoute] = useState<string | null>(null);
  const [selectedStop, setSelectedStop] = useState<string | null>(null);

  const pageStyle: React.CSSProperties = {
    backgroundColor: "#003057",
    color: "#ffffff",
    minHeight: "100vh", // Full height of the viewport
    padding: "20px",
    boxSizing: "border-box",
  };

  const topLeftTextStyle: React.CSSProperties = {
    position: "absolute",
    top: "10px",
    left: "10px",
    color: "#b3a369",
    fontFamily: '"Inter-Bold", Helvetica',
    fontSize: "14px",
    fontWeight: 500,
    lineHeight: "normal",
    marginTop: "20px",
    marginLeft: "20px",
  };

  const labelStyle: React.CSSProperties = {
    height: "154px",
    width: "837px",
    position: "relative",
    margin: "0 auto",
  };

  const textWrapperStyle: React.CSSProperties = {
    color: "#b3a369",
    fontFamily: '"Inter-Bold", Helvetica',
    fontSize: "64px",
    fontWeight: 700,
    letterSpacing: "-1.28px",
    lineHeight: "normal",
    position: "relative",
    textAlign: "center",
    margin: "100px auto",
    width: "837px",
  };

  const dropdownLabelStyle: React.CSSProperties = {
    color: "#b3a369",
    fontFamily: '"Inter-Bold", Helvetica',
    fontSize: "18px",
    fontWeight: 600,
    lineHeight: "normal",
    textAlign: "left",
  };

  const dropdownContainerStyle: React.CSSProperties = {
    display: "flex",
    flexDirection: "column",
    alignItems: "flex-start",
    margin: "0 auto",
    width: "200px",
    marginBottom: "20px",
  };

  return (
    <div style={pageStyle}>
      {/* Top Left Text */}
      <div style={topLeftTextStyle}>GT Stinger Delay</div>

      {/* Title Section */}
      <div style={labelStyle}>
        <div style={textWrapperStyle}>
          Georgia Tech Stinger Shuttle Delay Visualizer
        </div>
      </div>

      {/* Description */}
      <p
        style={{
          fontSize: "18px",
          color: "lightgray",
          marginBottom: "30px",
          marginTop: "30px",
        }}
      >
        A Big Data Big Impact project by the Georgia Tech Data Science Club.
      </p>

      {/* Dropdown for Routes */}
      <div style={dropdownContainerStyle}>
        <label htmlFor="route-select" style={dropdownLabelStyle}>
          Choose your bus line
        </label>
        <select
          id="route-select"
          onChange={(e) => {
            setSelectedRoute(e.target.value);
            setSelectedStop(null);
          }}
          value={selectedRoute || ""}
          style={{ marginTop: "10px", fontSize: "16px", width: "100%" }}
        >
          <option value="" disabled>
            Select a route
          </option>
          {Object.keys(busRoutes).map((route) => (
            <option key={route} value={route}>
              {route}
            </option>
          ))}
        </select>
      </div>

      {/* Dropdown for Stops */}
      {selectedRoute && (
        <div style={dropdownContainerStyle}>
          <label htmlFor="stop-select" style={dropdownLabelStyle}>
            Current stop
          </label>
          <select
            id="stop-select"
            onChange={(e) => setSelectedStop(e.target.value)}
            value={selectedStop || ""}
            style={{ marginTop: "10px", fontSize: "16px", width: "100%" }}
          >
            <option value="" disabled>
              Select a stop
            </option>
            {busRoutes[selectedRoute as keyof typeof busRoutes].map((stop) => (
              <option key={stop} value={stop}>
                {stop}
              </option>
            ))}
          </select>
        </div>
      )}

      {/* Map Placeholder */}
      {selectedRoute && selectedStop && (
        <div style={{ marginTop: "30px" }}>
          <p>
            Displaying map for <strong>{selectedRoute}</strong> at{" "}
            <strong>{selectedStop}</strong>.
          </p>
          <div
            style={{
              width: "300px",
              height: "200px",
              backgroundColor: "#ddd",
              margin: "0 auto",
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              border: "1px solid #ccc",
            }}
          >
            Static Map Image
          </div>
        </div>
      )}
    </div>
  );
};

export default Home;
